import { API, wrapPromise } from 'utils/api';

function fetchPostingDetail({ index } = {}) {
	return API.get(`/web/PostingDetail/${index}`);
}

export const fetchWddData = ({ index } = {}) => {
	const postingDetail = fetchPostingDetail({ index });
	return {
		postingDetail: wrapPromise(postingDetail),
	};
};
